class FetchInfo extends Component{
    constructor(props){
        super(props);
        this.state={
            hide: false
        };

    }

    render(){

        return(
            <section className={'hero'}>
                <ExcursionList data={this.props.data}  hide={this.props.hide}/>
            </section>
        )

    }
}

export default FetchInfo;
